import React from "react";

const Navbar = ({ setMain }) => {
  return (
    <div style={{ height: "60px" }} className="row no-gutters mb-2">
      <div className="col-auto p-1 mr-2">
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("server");
          }}
        >
          Server
        </div>
      </div>
      <div className="col-auto p-1 mr-2">
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("users");
          }}
        >
          Users
        </div>
      </div>
      <div className="col-auto p-1">
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("stats");
          }}
        >
          Stats
        </div>
      </div>
      <div className="col p-1">
        <div className="row no-gutters justify-content-end h-100">
          <div
            className="h-100 convex-1"
            style={{
              borderRadius: "50px",
              display: "flex",
              alignItems: "center",
              justifyContent: "space-between",
              width: "380px",
              padding: "0 30px",
            }}
            onClick={() => {
              setMain("stats");
            }}
          >
            <div>
              <div style={{ width: "30px", heigth: "30px" }}>
                <img alt={y[x]} src={y[x]} className="img-fluid"></img>
              </div>
              Admin
            </div>
            <div>Dashboard</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
